    [],nt"num_tags": 0,nt"name": "ocean-surface-topography-mission-ostm-jason-2-orbital-information-nodc-accession-0044985",nt"isopen":
    false,nt"url": null,nt"notes": "This accession contains the descriptions
    for the OSTM/Jason-2 orbital information, which is served through the NOAA/NESDIS
    Comprehensive Large Array-data Stewardship System (CLASS): http://www.class.noaa.govnnOSTM/Jason-2
    is a follow-on mission to Jason-1, which takes over and continues the TOPEX/Poseidon
    and Jason-1 missions. OSTM/Jason-2 involves Centre National d'Etudes Spatiales (CNES),
    NASA and 2 new partners: the European Organisation for the Exploitation of Meteorological
    Satellites (EUMETSAT) and NOAA in order to 1) ensure continuity of high quality
    measurements for ocean science, and 2) provide operational products for assimilation
    and forecasting applications. OSTM/Jason-2 was launched on 20 June 2008 and reached
    its nominal repetitive orbit on 4 July 2008. The start of cycle 1 occurred on 12
    July 2008.nnThese files are produced by CNES for offline (IGDR, GDR) data production.
    For GPSP1, intermediate level-1 data files are in "RINEX" format and from the
    Global Positioning System (GPS) receiver and are used to compute precise GPS orbits
    for the spacecraft. For TLE: Two Line Element files are used to determine the position
    and velocity of the satellite. Within CLASS, they will be used directly to determine
    each orbit's equator crossing longitude and time which subsequently are used to
    support spatial search. For MOE and POE, medium-precision and precision orbital
    ephemeris files are from the DORIS system. All members of the Orbital Information
    family were made unrestricted on 15 December, 2008.nnOther data/products associated
    with OSTM/Jason-2 are also provided through CLASS. They are: Level-2 Geophysical
    Data Records (GDRs), ancillary and auxiliary data files used to generate Level-2
    products, quality reports from the near real-time altimetry validation system (NRTAVS)
    and telemetry data. The descriptions of these data products can also be accessed
    in other accessions at NODC.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
